import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";
import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
          <Navbar/>
          <Footer/>
      </div>
    </Router>
  );
}

export default App;
